import React, { useEffect } from "react";

function Home() {
    useEffect(() => {
        document.title = "Property Booking Management System"
    }, [])

    return (
        <div>
            <div className="alert alert-info text-center w-100 p-3 ml-3" role="alert">
                <h2>Welcome to PBMS</h2>
            </div>
            <div className="justify-content-center">
                <img src="https://i.postimg.cc/hPnqXfNJ/draw2.webp" className="img-fluid img-responsive center-block" alt="Sketch Logo"></img>
            </div>
        </div>
    )
}

export default Home;
